create table sys_dict
(
    id                 varchar(32)                                           not null comment '编号'
        primary key,
    name               varchar(100)                                          not null comment '标签名',
    val                varchar(100)                                          null comment '数据值',
    code               varchar(100)                                          not null comment '类型',
    parent_id          varchar(32)                                           null comment '父菜单ID',
    parent_ids         varchar(2000)                                         null comment '父菜单IDs',
    sort               int                                                   not null comment '排序（升序）',
    available          bit                      default b'1'                 null comment '是否显示1 是0否',
    leaf               bit                      default b'0'                 null comment '1 叶子节点 0 非叶子节点',
    created_by         varchar(50)                                           not null,
    created_date       timestamp(3)             default CURRENT_TIMESTAMP(3) not null comment '创建时间',
    last_modified_by   varchar(50)                                           null,
    last_modified_date timestamp(3)             default CURRENT_TIMESTAMP(3) not null on update CURRENT_TIMESTAMP(3) comment '更新时间',
    version            int                      default 0                    not null,
    description        varchar(100)                                          null comment '描述',
    del_flag           char collate utf8mb4_bin default '0'                  null comment '0-正常，1-删除'
)
    comment '字典表' charset = utf8;

create index sys_dict_label
    on sys_dict (name);

create index sys_dict_value
    on sys_dict (val);

